function manualSwap() external {
    // Only the tax wallet is authorized to trigger a manual swap
    require(msg.sender == _taxWallet, "Caller is not authorized");

    // Contract address must not be excluded from fees
    require(!_isExcludedFromFee[address(this)], "Contract is excluded from fees");

    uint256 contractTokenBalance = balanceOf(address(this));
    if (contractTokenBalance == 0) {
        return;
    }

    // Swap all tokens held by the contract for ETH
    _swapTokensForEth(contractTokenBalance);

    // Forward any ETH obtained from the swap to the tax wallet
    uint256 contractETHBalance = address(this).balance;
    if (contractETHBalance > 0) {
        _taxWallet.transfer(contractETHBalance);
    }
}

